import React, { useContext, useEffect, useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { DataContext } from "../../DataContext";
import "./PageHeader.css";

export default function PageHeader() {
  const navigate = useNavigate();


  const { user, logout } = useContext(DataContext);

  const [openMenu, setOpenMenu] = useState(false);
  const [cartCount, setCartCount] = useState(0);

  /* ================= USER MENU ================= */
  const toggleMenu = () => setOpenMenu((prev) => !prev);

  /* ================= CART COUNT ================= */
  useEffect(() => {
    // ch∆∞a login ‚Üí kh√¥ng c√≥ cart
    if (!user?.email) {
      setCartCount(0);
      return;
    }

    const key = `cart_${user.email}`;

    const updateCartCount = () => {
      try {
        const cart = JSON.parse(localStorage.getItem(key)) || [];
        const total = cart.reduce(
          (sum, item) => sum + (item.quantity || 0),
          0
        );
        setCartCount(total);
      } catch (err) {
        setCartCount(0);
      }
    };

    // load l·∫ßn ƒë·∫ßu
    updateCartCount();

    // l·∫Øng nghe thay ƒë·ªïi gi·ªè
    window.addEventListener("storage", updateCartCount);

    return () => {
      window.removeEventListener("storage", updateCartCount);
    };
  }, [user?.email]);

  /* ================= CART CLICK ================= */
  const goToCart = () => {
    if (!user) {
      alert("B·∫°n c·∫ßn ƒëƒÉng nh·∫≠p ƒë·ªÉ xem gi·ªè h√†ng!");
      navigate("/login");
      return;
    }
    navigate("/cart");
  };

  return (
    <header className="uh-header">
      <div className="uh-container">
        {/* ===== LOGO ===== */}
        <div className="uh-logo" onClick={() => navigate("/")}>
          Mobile<span>S</span>tore
        </div>

        {/* ===== NAV ===== */}
        <nav className="uh-nav">
          <Link to="/">Trang ch·ªß</Link>
          <Link to="/products">S·∫£n ph·∫©m</Link>
          <Link to="/news">Tin t·ª©c</Link>
          <Link to="/contact">Li√™n h·ªá</Link>
          {user && <Link to="/my-orders">ƒê∆°n h√†ng</Link>}
        </nav>

        {/* ===== ACTIONS ===== */}
        <div className="uh-actions">
          {/* USER */}
          {user ? (
            <div className="uh-user">
              <div className="uh-avatar" onClick={toggleMenu}>
                {user.avatar ? (
                  <img src={user.avatar} alt="avatar" />
                ) : (
                  user.fullName?.charAt(0)?.toUpperCase() || "U"
                )}
              </div>

              {openMenu && (
                <div className="uh-menu">
                  <div onClick={() => navigate("/profile")}>
                    üë§ Th√¥ng tin
                  </div>
                  <div onClick={() => navigate("/my-orders")}>
                    üì¶ ƒê∆°n h√†ng
                  </div>
                  <div onClick={logout}>üö™ ƒêƒÉng xu·∫•t</div>
                </div>
              )}
            </div>
          ) : (
            <button
              className="uh-login"
              onClick={() => navigate("/login")}
            >
              ƒêƒÉng nh·∫≠p
            </button>
          )}

          {/* CART */}
          <div className="uh-cart" onClick={goToCart}>
            üõí
            {cartCount > 0 && (
              <span className="uh-cart-count">{cartCount}</span>
            )}
          </div>
        </div>
      </div>
    </header>
  );
}
